import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom"
import React, {useState} from "react";
import {List} from "./components/list/list";
import {Head} from "./components/head/head";
import {Survey} from "./components/survey/survey";

function App() {
  const [action, setAction] = useState("view")
  const [object, setObject] = useState("survey")
  const [is_login,setIs_login] = useState(false)
  return (
      <Router>
        <Head setAction={setAction} setObject={setObject} is_login={is_login} setIs_login={setIs_login} object={object}/>
          <Switch>
            <Route exact path="/">
              <List action={action} object={object} setAction={setAction} setObject={setObject}/>
            </Route>
            <Route path="/survey">
              <Survey />
            </Route>

            <Route path="/survey">
              <Survey />
            </Route>

          </Switch>

      </Router>
  );
}

export default App;
